AD COUNCIL PRIVACY POLICYEFFECTIVE DATE: October 3, 2014The Advertising Council, Inc. (“Ad Council”, “we”,“us”, or “our”) operates, hosts, and manages a number of websites, including without limitation, http://adcouncil.org, https://www.psacentral.org, and http://www.adlibbing.org (collectively, “Websites”).  Our Websites may also include the websites of our campaign sponsors where we host or manage the websites.  This Privacy Policy describes, among other things, the types of information we collect, how we use it, and how we share the information.  Any terms not defined in this Privacy Policy are defined in our Terms of Use (“Terms”).PLEASE READ THIS PRIVACY POLICY CAREFULLY BECAUSE IT, ALONG WITH OUR TERMS, FORMS A LEGALLY BINDING AGREEMENT BETWEEN YOU AND US.  IF YOU DO NOT AGREE WITH THIS PRIVACY POLICY,YOU MAY NOT USE OUR WEBSITES.INFORMATION WE COLLECT AND HOW WE USE ITWe use the term “Personal Information” to refer to any information you provide in connection with your use of any of our Websites by which you can be personally identified.  Personal Information may include such things as your name, street address, telephone number, date of birth, e-mail address and any other information which might reasonably be used to identify you.  We obtain Personal Information from you when you submit it to us.  We may use your Personal Information to register or subscribe you for certain features, functions, services, activities, games, promotions and content on our Websites (these are referred to as “Content” in our Terms).  You may also email us with a question or for more information and we will use your contact information (which includes Personal Information such as an email address) to respond to your question or request.  If you provide or submit your Personal Information to any of our Websites, we will give you the right to review, update and/or delete your Personal Information, subject to our obligations to comply with legal, regulatory our internal audit and record-keeping requirements.  We may also use your Personal Information to notify you of updates, promotional offers, or important information about our Websites and services.As part of an SMS/text message service that we provide in connection with a particular campaign, we may collect your cell phone number, your carrier’s name, and the date, time and content of your messages, as well as other information that you provide.  We may use this information to contact you and to provide the services you request from us.When you access or visit any of our Websites, we and our operational service providers may use technology that can recognize, collect and/or transmit information that is associated with your device.  Although the term “cookie” specifically refers to a small text file that is stored on a user’s computer for record-keeping purposes, we will use the term “cookie” to refer generically to any technology that can recognize, collect and/or transmit information about your visits to our Websites.  This type of information includes such data as the Internet or web domain that referred you, the type of operating system and browser you are using, the date and time of your visit, data relating to activities on our Websites (e.g., so-called ‘clickstream’ data) and other technological attributes about your visit to our Websites.  This information may be used by us, among other purposes, to analyze trends, administer our Websites, track user movements on our Websites, and gather aggregate demographic information about visitors so we can continually improve our Websites.We may also use cookies on our Websites to recognize a user’s device each time it is used to visit a particular Website and to keep count of how often you return. Cookies can also track how you use our Websites, your preferences for features and functions and, for Websites that have registration or similar features, cookies can store information such as your user name and password so you don’t have to re-enter them each time you return to visit.You can disable or turn the cookie feature off by changing the settings on your Internet browser and you can also change the settings to stop your browser from automatically accepting cookies.  Changing these settings may also require you to re-enter certain information each time you visit or attempt to use our Websites.SPONSORS, ADVERTISERS AND OTHER THIRD PARTIESOur Websites may contain or display information from our sponsors, advertisers, operational service providers or others (each, a “Third Party” and collectively, “Third Parties”).  These Third Parties may make information, goods or services available on our Websites, provide opportunities to participate in promotions on our Websites, or engage in activities that link or redirect your browser to their websites. We may also use Third Parties to display or serve advertising on our Websites, as well as for distributing our online, email, messaged or web-based newsletters and other information. Third Parties often also employ cookies to measure advertising effectiveness. You should be aware that even if you encounter an advertisement, link or reference to a Third Party website on one of our Websites and even if we have a relationship with them, we are not responsible for the practices or policies of their websites or any rules they have regarding the use of cookies or collection, use or disclosure of your information (including Personal Information).  These practices are withintheir control and not ours.  As such, insuch instances, their privacy policies will govern and apply.DISCLOSURE TO THIRD PARTIESOur policy is to not sell, rent, lease, provide or otherwise disclose your Personal Information to unaffiliated entities unless otherwise described in this Privacy Policy. Notwithstanding the foregoing, we may disclose your Personal Information to any Third Party we engage for the purpose of administering, operating, configuring site design, maintaining and providing internal support for our Websites and Content. These Third Parties are called “operational service providers,” and they provide internal support to operations and activities and/or for Site design, development, hosting and operations.We also reserve the right to make your Personal Information available:

When we are compelled by a governmental agency, law, regulation, a court or other legal process; 
If we believe you are, have or may violate or inorder to enforce any law, regulation, our Terms;
If we believe you are or may be a threat to safety, property, interests or rights of us or others;
In order to investigate, respond to or resolve problems or inquiries or defend our interests;
In a merger, acquisition, change of control, joint venture or other business combination; or
When you otherwise consent 

You should also be aware we are a public service organization and simply because a website or web page includes our logo, name or otherwise refers to us, does not mean the website or web page is ours or under our control.  We work with sponsors, advertisers, government agencies, and other Third Parties to bring you public service advertising and if you enter, provide or submit Personal Information on or to a co-branded website or web page you may be subject to the terms, conditions and privacy policies of the Third Party sponsor, advertiser, government agency or co-branding organization.SECURITYWe maintain reasonable standards of security and confidentiality. We also try to limit information access to individuals who need to have such access to perform their responsibilities associated with our Websites and the Content. While we strive to protect your Personal Information, we cannot guarantee the security of your Personal Information and your communications when using our Websites.YOUR CHOICESIn general, we provide you with the ability to correct or update your Personal Information. In some instances, some Personal Information may not be changed or deleted by you and requires you to contact us for verification (e.g., birth date, email address, name). In general, we offer you the ability to opt out of receiving commercial emails and other commercial communications from us in the future. Our Websites and/or email communications will provide you with instructions and the procedures you can use to opt out when applicable.YOUR CALIFORNIA PRIVACY RIGHTSCalifornia law permits our customers who are California residents to request and obtain from us information about the personal information (if any) we disclosed to third parties for their direct marketing purposes in the preceding calendar year.  If applicable, this information would include a list of the categories of personal information that was shared and the names and addresses of all third parties with which we shared information in the immediately preceding twelve calendar months.  At this time, we do not disclose your personal information with third parties for their direct marketing purposes so this requirement does not apply to us.CHILDRENYou may not submit your personal information unless you are at least 13 years old.  Children under the age of 13 that have registered with this Website are in violation of our Terms.  If you believe that your child under the age of 13 has provided his or her personal information to us, please notify us immediately by contacting us at webmaster@adcouncil.org.  You may be required to provide verifiable identification that you are the child’s parent or legal guardian.CHANGES TO PRIVACY POLICYWe may edit, amend, modify and update our Privacy Policy at any time by posting updated text on or links to our Websites.  When we make material changes to our Privacy Policy, we will notify you by posting a notice on our Websites.  We display the Effective Date at the top of our Privacy Policy so that you will know when there has been a change.  Your continued use of our Websites after any such changes constitutes your acceptance to the modified terms and conditions set forth herein.CONTACT USFor questions about our Privacy Policies please email us at webmaster@adcouncil.org or write us to the attention of our VP, Digital and PRISM, at 815 Second Avenue, 9thFloor, New York, NY 10017 and please specify if you are inquiring about a specific Website to help us better assist and respond to your questions.Copyright © 2014 The Advertising Council, Inc. All Rights ReservedPrivacy Policy in Spanish
